        signHash: function (hash, resultFunction, closeFunction) {
            if (document.getElementById("CryptoPluginBlock")!==null){
                console.log("asynchronous call signHash, command was ignored");
                if (typeof closeFunction === "function"){
                    closeFunction();
                }
                return;
            }
            cpGUI.prepareBlock();

            if (hash.constructor === Array || hash === "") {
                cpGUI.hash = hash;
            } else {
                cpGUI.hash = [hash];
            }
            cpGUI.result = [];
            cpGUI.needInternet = true;
            cpGUI.closeFunction = closeFunction;
            cpGUI.finalErrorFunction = null;

            if (localStorage.getItem("CryptoPluginTimeStamp") && localStorage.getItem("CryptoPluginTimeStamp")==="noTime"){
                cpGUI.tspURL = null;
                cpGUI.signingTime = false;
            } else if (localStorage.getItem("CryptoPluginTimeStamp") && localStorage.getItem("CryptoPluginTimeStamp")==="systemTime"){
                cpGUI.tspURL = null;
                cpGUI.signingTime = true;
            } else {
                cpGUI.tspURL = "http://acsk.privatbank.ua/services/tsp/";
                cpGUI.signingTime = false;
            }
            cpGUI.aliases = null;
            function sighHashRecursion(i, resultFunction){
                var index = parseInt(i);
                if(typeof index !== 'number' || index < 0 || !cpGUI.hash){
                    cpGUI.cleanUp(function(){
                        return function(){
                            resultFunction(cpGUI.result);
                        }
                    }());
                } else {
                    var hash = cpGUI.hash[index];
                    if(cpGUI.aliases && cpGUI.aliases.length > 0){
                        // Подписание с печатью
                        cpGUI.plugin.selectKey(cpGUI.aliases[0], "", function () {
                            cpGUI.plugin.CMSSignHash(hash, "", "", cpGUI.tspURL, true, "", true, "", cpGUI.signingTime, function (result) {
                                if (result && result.hasOwnProperty("sign")) {
                                    cpGUI.result.push({hash: hash, sign: result.sign});
                                }
                                if (cpGUI.aliases.length > 1) {
                                    cpGUI.plugin.selectKey(cpGUI.aliases[1], "", function () {
                                        cpGUI.plugin.CMSSignHash(hash, "", "", cpGUI.tspURL, true, "", true, "", cpGUI.signingTime, function (result) {
                                            if (result && result.hasOwnProperty("sign")) {
                                                cpGUI.result.push({hash: hash, sign: result.sign});
                                            }
                                            sighHashRecursion(--index, resultFunction);
                                        }, cpGUI.errorFunction);
                                    }, cpGUI.errorFunction);
                                } else {
                                    sighHashRecursion(--index, resultFunction);
                                }
                            }, cpGUI.errorFunction);
                        }, cpGUI.errorFunction);
                    } else {
                        cpGUI.plugin.CMSSignHash(hash, "", "", cpGUI.tspURL, true, "", true, "",  cpGUI.signingTime, function (result) {
                            if (result && result.hasOwnProperty("sign")) {
                                cpGUI.result.push({hash: hash, sign: result.sign});
                            }
                            sighHashRecursion(--index,resultFunction);
                        }, cpGUI.errorFunction);
                    }
                }
            }
            cpGUI.finalFunction = function () {
                return function () {
                    if (!cpGUI.hash || cpGUI.hash == "" || !cpGUI.hash.hasOwnProperty("length") || !cpGUI.hash.length) {
                        // Check plugin mode
                        cpGUI.cleanUp(function(){
                            return function(){
                                resultFunction();
                            }
                        }());
                    } else {
                        sighHashRecursion( cpGUI.hash.length - 1, resultFunction);
                    }
                }
            }();
            cpGUI.selectKey = true;
            if (cpGUI.plugin == null){
                CryptoPlugin.connect(function (plugin) {
                    cpGUI.plugin = plugin;
                    setTimeout(cpGUI.preparePlugin, 10);
                }, cpGUI.errorFunction);
            } else {
                cpGUI.preparePlugin();
            }
        },
